import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="nav container">
      <Link to={'/'} className="nav_logo">
        {'Mohit'}
      </Link>

      <div className="nav_menu">
        <ul className="navList grid"></ul>
      </div>
    </nav>
  );
};

export default Navbar;
